💡Ежеквартальный областной «Урок о важном: равнение на героя» 💡

Мероприятие состоялось 11 декабря. Приглашенными гостями «Урока о важном» являлись : 

✔️ Станкевич Игорь Валентинович, Герой России, политический и общественный деятель, руководитель общественной
организации «Герои Отечества»; 
✔️Ястребков Антон Александрович, заместитель регионального председателя Межрегиональной общественной организации
«Общество содействия патриотическому воспитанию населения и поддержки
ветеранов боевых действий и их семей «СВОИ»; 
✔️Кузёмин Сергей Владимирович, руководитель регионального отделения Всероссийской общественной организации «Федерация Лазертага России» по Самарской области; 
✔️участники акции «Чебурашка для Героя».

Студенты 1 и 2 корпуса нашего колледжа приняли участие в данном событии и с интересом слушали героев выпуска ⚡️
